import "bootstrap/dist/css/bootstrap.min.css";

import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Button } from "react-bootstrap";
import Card from "react-bootstrap/Card";

function Donationhome() {
  const navigate = useNavigate();

  const [selected, setSelected] = useState("yes");
  const handleChange = (event) => {
    console.log(event.target.value);
    setSelected(event.target.value);
  };

  

  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <Card style={{ width: "29rem" }}>
          <Card.Header>
            <h3>Please fill the details below</h3>
          </Card.Header>
          <Card.Body>
            <form>
              <table>
                <h6>Personal details</h6>
                <Row>
                  <Col>
                    <input
                      name="donation_first_name"
                      placeholder="First Name"
                    />
                  </Col>
                  <Col>
                    <input name="donation_last_name" placeholder="Last Name" />
                  </Col>
                </Row>
                <br></br>
                <Row>
                  <h6>Address details</h6>
                </Row>

                <Row>
                  <Col>
                    <input name="country" placeholder="Country" />
                  </Col>
                  <Col>
                    <input name="country" placeholder="Country" />
                  </Col>
                </Row>
                <br></br>
                <Row>
                  <h6>Contact details</h6>
                </Row>

                <Row>
                  <Col>
                    <input name="email" placeholder="Email id" />
                  </Col>
                  <Col>
                    <input name="mobile" placeholder="Mobile Number" />
                  </Col>
                </Row>
                <br></br>
                <Row>
                  <h6>Donation type</h6>
                </Row>
                <input
                  type="radio"
                  id="money"
                  name="donationtype"
                  value="money"
                  checked={selected === "money"}
                  onChange={handleChange}
                />
                <label htmlFor="money">Donate Money</label>

                <br></br>

                <input
                  type="radio"
                  id="clothes"
                  name="donationtype"
                  value="clothes"
                  onChange={handleChange}
                  checked={selected === "clothes"}
                />
                <label for="clothes">Food/Clothes</label>

                <br></br>
                <br></br>

                <Row>
                  <Col>
                    <Button
                      className="d-flex justify-content-center"
                      onClick={() => {
                        if (selected === "money") {
                          navigate("/moneyhome");
                        } else if (selected === "clothes") {
                          navigate("/Foodcloth");
                        } else {
                          alert("Please select Donation type");
                        }
                      }}
                    >
                      Next
                    </Button>
                  </Col>
                  <Col>
                    <Button
                      className="d-flex justify-content-right"
                      onClick={() => {
                        navigate("/");
                      }}
                    >
                      Back
                    </Button>
                  </Col>
                </Row>
              </table>
            </form>
          </Card.Body>
        </Card>
      </div>
    </>
  );
}

export default Donationhome;
